   // src/App.js
   import React from 'react';
   import CodeEditorWithSuggestions from './components/CodeEditorWithSuggestions';
   import Login from './components/Login/Login';

   const App = () => {
       return (
           <div>
               <Login />
               <h1>在线代码平台</h1>
               <CodeEditorWithSuggestions />
           </div>
       );
   };

   export default App;
